import './Header.css'
function Header() {
    const navLinks = [
        {
            title: 'Home',
            href:'localhost/home'
        },
        {
            title: 'About',
            href:'localhost/About'
        },
        {
            title: 'Contact',
            href:'localhost/Contact'
        },
    ]
    return (
        <div className='Header'>
            <h3>logo</h3>
            <ul>
                {
                    navLinks.map(item => (
                        <li>{item.title}</li>
                    ))
                }

            </ul>
        </div>
    )

}
export default Header
